import React from 'react';
import{Line} from 'react-chartjs-2'
function Linechart(){
    const data={
        labels :['jan','fab','mars','april','may'],
        dataSets :[
            {
                label:'Sales for 2020(M)',
                data:[3,2,2,1,5]
            }
        ]
    }
    return(
       <Line data={data}/>
    )
}
export default Linechart;
